column2:
@flanvel @CryptoAussie @dguido "code being so insufficient you can steal another person's assets without them interacting."

any evidence for the OS protocol being broken to this degree? really?

you linked to a research piece describing smart contract exploits in general, hardly evidence for your claims.

@flanvel @CryptoAussie @dguido "log in with the stolen data" ??? 

I don't think you understand how this works. 

If you phish someone into signing a malicious message, you didn't "login to another users opensea account using stolen data"

@NFTshinobii what do you mean "due to current breaches?"

it's likely this theft was entirely your own end-user error. 

you moved it to a new wallet and it still got breached? think you need to audit your machine / network immediately.

@HH_Clowd @OlgaRodinaNFT @opensea Look it's important to understand what connecting your wallet means. 
By connecting your wallet to a website you are merely revealing your wallet address, basically public information. 
You are not giving them any special permission to execute anything on your behalf by connectin
